import { useEffect, useState } from "react";

import { useParams } from 'react-router-dom'


function User() {
    const [user, setUser] = useState({})
    const { id } = useParams();

    useEffect(() => {
        axios(`https://jsonplaceholder.typicode.com/users/${id}`)
            .then(res => setUser(res.data))
    }, [])
    return (
        <div>
            <h1>User Detail</h1>
            id: {id}
        </div>
    )
}

export default User;
